import React, { useState } from "react";
import {
  // Container,
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  Button,
  // NavbarText
} from "reactstrap";
import "./NavbarLanding.css";

const Header = (props) => {
  const [isOpen, setIsOpen] = useState(false);
  const toggle = () => setIsOpen(!isOpen);

  const [showModal, setShowModal] = useState(false);
  const [showModalLog, setShowModalLog] = useState(false);
  const openModal = () => {
    setShowModal((prev) => !prev);
  };
  const openModalLog = () => {
    setShowModalLog((prev) => !prev);
  };

  return (
    <div className="main-header">
      <div className="containerNav px-1">
        <Navbar expand="lg">
          <NavbarBrand href="/">
            <h3 style={{ color: "black" }}>
              <span style={{ color: "#7971EA" }}>Fun</span>d.
            </h3>
          </NavbarBrand>
          <NavbarToggler onClick={toggle} />
          <Collapse isOpen={isOpen} navbar>
            <Nav className="header-link ml-auto" navbar>
              <NavItem className="header-link">
                <NavLink href="/">About</NavLink>
              </NavItem>
              <NavItem className="header-link">
                <NavLink href="/">Product</NavLink>
              </NavItem>
              <NavItem className="header-link">
                <NavLink onClick={openModal}>Login</NavLink>
              </NavItem>
              <Modal showModal={showModal} setShowModal={setShowModal} />
              <Button className="header-button" onClick={openModalLog}>
                Sign Up
              </Button>{" "}
              <ModalLog
                showModalLog={showModalLog}
                setShowModalLog={setShowModalLog}
              />
            </Nav>
          </Collapse>
        </Navbar>
      </div>
    </div>
  );
};

export default Header;
